import{_ as l,o as i,c as s,a as b,d as e,f as p,b as r}from"./app-9d24966c.js";const t="data:image/png;base64,",a="/documentation/assets/Property(1)-3a4a98c7.png",A="/documentation/assets/FutProperty-ff1ea252.png";const o={},n=e("h1",{id:"fut",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#fut","aria-hidden":"true"},"#"),p(" FUT")],-1),u=r('<p><b style="font-size:20px;">1) FUT</b><br> 파일 처리 기능으로 Delete, Move, Copy, Rename 4가지 기능을 하는 Component입니다.</p><p><b style="font-size:20px;">(1) BOC 이미지</b><br> BOC 컴포넌트 목록에서 FUT BOC을 선택하여 Drag-Drop으로 화면작업 영역에 디자인합니다. <br><img src="'+t+'" style="position:relative;top:5px;width:150px;"> <br></p><p><b style="font-size:20px;">(2) 속성</b><br> 화면 작업창에서 FUT BOC 선택 시 속성 창에 설정이 가능한 항목에 값을 입력합니다. <br><img src="'+a+'" class="boxBorder" style="position:relative;top:5px;width:300px;"> <br><b style="font-size:20px;">➀ 기초정보 </b><br></p><ul><li><p><b style="font-size:20px;">OBJECT명 </b><br> 해당 BOC가 실행된 후 해당 결과 SET을 저장할 Value Object의 명을 지정합니다. 해당 Object의 결과 Set은 그리드 형식의 Object로 구성됩니다.<br></p></li><li><p><b style="font-size:20px;">논리명칭 </b><br> BOC가 어떤 동작을 수행하는지를 간단한 명칭으로 기술합니다. 해당 명칭을 처리 흐름을 간략하게 표현할 수 있도록 기술합니다.<br></p></li><li><p><b style="font-size:20px;">논리설명 </b><br> 논리명칭으로 표현하기 부족할 때 좀 더 상세히 내용을 기술합니다.</p></li></ul><p><b style="font-size:20px;">➁ 입력부</b><br></p><ul><li><p><b style="font-size:20px;">입력 OBJECT</b><br> 추출 대상 데이터 Object명을 선택합니다.</p></li><li><p><b style="font-size:20px;">입력 항목</b><br> 입력 컬럼을 지정합니다.</p></li><li><p><b style="font-size:20px;">출력 항목</b><br> 출력 컬럼을 지정합니다.</p></li><li><p><b style="font-size:20px;">파일처리속성 </b><br> Move, Copy, Rename 처리 시 중복되는 경우 덮어 씌우거나 번호를 넣어 중복되지 않는 처리 유형을 선택합니다.</p></li></ul><p><b style="font-size:20px;">➂ 출력부</b><br></p><ul><li><p><b style="font-size:20px;">Column Scroll </b><br> 해당 BOC 목록이 많을 때 true로 설정했을 때 Display Count에서 설정한 개수만큼 보여주고 나머지 목록은 ▲▼ 버튼으로 확인할 수 있습니다.</p></li><li><p><b style="font-size:20px;">Display Count </b><br> 해당 BOC 목록이 많을 때 목록에 보이는 개수를 설정합니다.</p></li><li><p><b style="font-size:20px;">화면출력유형 </b><br> None: Default<br> Dataset : View Designer에서 그리드 컴포넌트에 조회 시 설정합니다. <br> Recode : JSP 출력방식일 때 단일 컴포넌트에 조회 시 설정합니다. <br> Page : JSP 출력방식일 때 페이징 시 설정합니다.<br> ChartLabel : View Designer에서 차트 컴포넌트에 범례를 설정합니다.<br> ChartData : View Designer에는 차트 컴포넌트에 데이터 조회 시 설정합니다. <br> Schedule : View Designer에서 스케줄 컴포넌트에 조회 시 설정합니다.<br></p></li></ul><p><b style="font-size:20px;">➃ 메시지부</b><br></p><ul><li><b style="font-size:20px;">결과메시지 </b><br> 해당 처리 결과에 대한 메시지를 Client. 즉, 호출자에게 보낼 필요가 있을 때 정의합니다.</li></ul><p><b style="font-size:20px;">➄ 선택항목</b><br></p><ul><li><p><b style="font-size:20px;">Alias전송명 </b><br> 전송하는 Object명의 Alias를 생성합니다.</p></li><li><p><b style="font-size:20px;">Log 수준 </b><br> Debug : 테스트 시에 로그 메시지를 정의할 수 있다. 데이터베이스 관련된 BOC는 ReturnData와 QueryData를 사용합니다.<br> ProcessHead : Seq번호, 프로세스 타입을 표시합니다.<br> InputData : 입력 데이터를 표시합니다.<br> ReturnData : 결과 데이터를 표시합니다.<br> Middle OutputData : 중간과정 결과 데이터를 표시합니다.<br> TabPage : 탭 페이지 결과를 표시합니다.<br> Math-Trace : Math의 계산식과 결과를 표시합니다.<br> Formula-Trace : Formula의 계산식과 결과를 표시합니다.<br> QueryData : 값이 포함된 쿼리를 표시합니다.<br> SCLTrace : SCLT BOC의 결과를 표시합니다.<br> PEX부가 Objects : PEX BOC의 부가적인 Object의 결과를 표시합니다.<br> 미사용 : 조건 컬럼부의 계산식값을 표시합니다.<br></p></li><li><p><b style="font-size:20px;">디렉토리생성 유형 </b><br> 파일 생성시 디렉토리 자동 생성 유무를 설정합니다.</p></li><li><p><b style="font-size:20px;">실행 조건 </b><br> 실행 조건에 값이 있는 경우 해당 실행 조건이 True가 아니면 실행이 되지 않습니다.</p></li><li><p><b style="font-size:20px;">파일중복처리유형 </b><br> 파일 업로드 시 중복될 경우 처리 유무를 설정합니다.</p></li></ul><p><b style="font-size:20px;">(3) FUT 컬럼의 파일처리구분</b><br><img src="'+t+'" style="position:relative;top:5px;width:150px;"> &gt; <img src="'+A+'" style="position:relative;top:5px;width:150px;"> <br> 컬럼들을 클릭해서 선택항목을 보면 파일 처리구분에 DestFname, DestPath, SrcFname, SrcPath 4가지 중에 컬럼 이름과 일치하는 것으로 선택한다. <br> 해당 컬에 저장이 되어 있는 값이 설정한 파일처리 구분의 의미를 가진다. 파일처리 구분을 지정한다.</p><ul><li>DestFname : Column의 값이 목적지 파일명으로 사용</li><li>DestPath : Column의 값이 목적지 파일명의 위치 정보로 사용</li><li>SrcFname : Column의 값이 소스 파일명으로 사용</li><li>SrcPath : Column의 값이 소스 파일명의 위치 정보로 사용</li></ul>',14);function c(S,m){return i(),s("div",null,[n,b(" FUT"),u])}const R=l(o,[["render",c],["__file","Fut.html.vue"]]);export{R as default};
